import React from 'react';

const Projects = () => {
    return (
        <div className='container about-page'>
          <div class="carousel-container">
            <div class="carousel">
              <div class="project">Проект 1</div>
              <div class="project">Проект 2</div>
              <div class="project">Проект 3</div>
              <div class="project">Проект 4</div>
              <div class="project">Проект 5</div>
            </div>
          </div>
          <script src='/projectsScript.js'></script>
        </div>
    );
};

export default Projects;

const carousel = document.querySelector('.carousel');
let index = 0;

function slideProjects() {
  index++;
  if (index >= 5) {
    index = 0;
  }
  carousel.style.transform = `translateX(-${index * 100}%)`;
}

setInterval(slideProjects, 3000);
